It seems like you've pasted `[object Object],[object Object]`, which typically appears when JavaScript objects are converted to strings implicitly (e.g., during `console.log` or string concatenation). 

### What This Means:
- `[object Object]` is the default string representation of a JavaScript object when it’s coerced into a string.
- The presence of two such items separated by a comma suggests you're seeing an array or list of two objects.

### Possible Causes:
1. **Debugging Output**: You might have logged objects directly (e.g., `console.log(obj1, obj2)`).
2. **Data Serialization Issue**: If you tried to display objects without properly serializing them (e.g., `alert(obj)` or `"" + obj`).
3. **API/Response Handling**: Raw object data might not have been parsed correctly (e.g., JSON).

### How to Fix/Inspect:
- **In a Browser/Console**: Use `console.dir(object)` or `JSON.stringify(object)` to see the actual content.
  ```javascript
  console.log(JSON.stringify([object1, object2], null, 2));
  ```
- **If this is from an API**: Ensure the response is parsed as JSON:
  ```javascript
  fetch('url').then(response => response.json()).then(data => console.log(data));
  ```

### Example:
If you have:
```javascript
const obj1 = { name: "Alice" };
const obj2 = { name: "Bob" };
console.log(obj1, obj2); // Outputs: [object Object] [object Object]
```
Instead, do:
```javascript
console.log(JSON.stringify([obj1, obj2], null, 2));
// Outputs:
// [
//   { "name": "Alice" },
//   { "name": "Bob" }
// ]
```

